import check from '../images/check.svg'
import cross from '../images/cross.svg'

export function InfoTooltip(props) {

    return (
      <div className={`popup ${props.isOpen ? 'popup_opened' : ''}`}>
        <div className='popup__container'>
            <img src={`${props.isSignedUp ? {check} : {cross} } `} className='popup__image'></img>
            <h3 className="popup__title popup__title_access">{`${props.isSignedUp} ? 'Вы успешно зарегистрировались!' : 'Что-то пошло не так!
Попробуйте ещё раз.' `}</h3>
            {props.children}
          <button className="popup__close-button" type="button" onClick={props.onClosePopup}></button>
        </div>
      </div>
    )
  }
